-- Cuantas películas ha realizado el actor __ED CHASE__.
select count(f.film_id) as peliculas from film as f join film_actor as fa on f.film_id = fa.film_id join actor as a on a.actor_id = fa.actor_id where a.first_name = 'Ed' and a.last_name = 'Chase';

-- +-----------+
-- | peliculas |
-- +-----------+
-- |        22 |
-- +-----------+

-- Media de duración de las películas cada categoría.
select avg(f.length) as media_duracion, c.name as categoria from film as f join film_category as fc on f.film_id = fc.film_id join category as c on c.category_id = fc.category_id group by categoria;

